import React from "react";
import { NavLink } from "react-router-dom";
import logo from "../images/recipeLogo";

const Nav = () => {
  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/">
            <img alt="cook it logo" src="{logo}" width="100" height="100" />
          </NavLink>
        </li>
        <li>
          <h2>The Authentic food</h2>
        </li>
        <li>
          <NavLink to="/SignIn">Sign In</NavLink>
          <NavLink className="signup" to="/SignUp">
            Sign Up
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
